			0% {
				transform: translateY(-48px);
			}

			100% {
				transform: translateY(0);
			}
		}

		@keyframes rotate360 {
			0% {
				transform: rotate(0);
				transform-origin: center 8px;
			}

			100% {
				transform: rotate(720deg);
				transform-origin: center 8px;
			}
		}

		html,
		p,
		div,
		a,
		body {
			margin: 0;
			padding: 0;
		}

		html {
			font-size: 62.5%;
			box-sizing: border-box;
			min-height: 100%;
		}

		body {
			line-height: 1.4;
			font: normal 14px Arial, sans-serif;
		}

		.notification-bar {
			position: relative;
			padding: 8px 12px;
			font-size: 14px;
			color: #FFFFFF;
			background-color: #4caf50;
			animation: slideInFromTop .5s ease-in-out;
		}

		.notification-bar__link {
			display: block;
			color: #fff;
			text-decoration: none;
		}

		.notification-bar__wrapper-text {
			float: left;
			margin: 0 8px 0 0;
			width: 100%;
			max-width: 60%;
		}

		.notification-bar__text {
			display: block;
			white-space: nowrap;
			overflow: hidden;
			text-overflow: ellipsis;
			position: relative;
			line-height: 30px;
			padding-left: 37px;
		}

		.notification-bar__text:before {
			border-radius: 50%;
			height: 30px;
			width: 30px;
			border: 2px solid;
			transition: all .2s;
			box-sizing: border-box;
			display: block;
			content: "";
			position: absolute;
			left: 0;
		}

		.notification-bar__text:after {
			position: absolute;
			content: "";
			top: 7px;
			left: 13px;
			width: 4px;
			height: 4px;
			box-shadow: inset 0 0 0 32px, 0 4px, 0 11px;
			animation: rotate360 .8s ease-in-out;
			animation-delay: .5s;
		}

		.notification-bar__button {
			display: inline-block;
			min-width: auto;
			padding: 8px 24px;
			text-align: center;
			background-color: #0288d1;
			border-color: #0288d1;
			font-weight: 600;
			border-radius: 4px;
			color: #fff;
		}

		.notification-bar__button:hover {
			background-color: #0278b8;
		}

		.notification-bar__label {
			float: none;
			position: absolute;
			top: 3px;
			left: 50px;
			font-size: 8px;
			font-family: Arial, Helvetica, sans-serif;
		}

		@media (min-width: 49em) {
			.notification-bar {
				padding: 8px 14px 8px 18px;
			}

			.notification-bar__label {
				float: right;
				position: relative;
				left: auto;
				top: auto;
				font-size: 10px;
			}

			.notification-bar__wrapper-text {
				max-width: 70%;
			}

			.notification-bar__button {
				min-width: 120px;
			}
		}

		@media (min-width: 64em) {
			.notification-bar__wrapper-text {
				max-width: 655px;
				margin: 0 14px 0 0;
			}
